    const pci = cleanLine.match(/PCI:\s*(\d+)/);
    const rsrp = cleanLine.match(/RSRP:\s*([-.\d]+)/);

    if (pci && rsrp) {
        msg.payload = {
            ...data,
            type: "NeighborDetail",
            pci: parseInt(pci[1]),
            rsrp: parseFloat(rsrp[1])
        };
